import { Card } from "react-bootstrap";
import styles from './card.module.css';

interface IProps { 
    title: string;
    text: string;
    funcao?: () => void; 
}

export default function ICard ({title, text, funcao}: IProps) {
    return (
        <Card className={styles.card} onClick={funcao}>
        <Card.Body>
          <Card.Title>{title}</Card.Title>
          <Card.Text>
            {text}
          </Card.Text>
        </Card.Body>
      </Card>
    )
}
